import React from "react";

function Customers() {
  return (
    <section id="Customers">
      <div
        style={{
          backgroundColor: "greenyellow",
          width: "auto",
          height: "100vh",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <div>
          <h1>Customer</h1>
        </div>
      </div>
    </section>
  );
}

export default Customers;
